import './App.css';
import { Landing } from './Landing-page/Landing-page';


function App() {
  const isLoggedIn = this.state.isLoggedIn;
  return (
    <div className="App">
      {isLoggedIn ? (
          <Landing/>
        ) : (
          <h1>hey</h1>
        )}
    </div>
  );
}

export default App;
